```solidity
pragma solidity 0.6.12;

import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/master/contracts/math/SafeMath.sol";

contract YourContract {
    using SafeMath for uint256;

    string public name;
    string public symbol;
    uint256 public totalsupply;
    uint256 public price;
    uint256 public decimals;
    address payable public owner;

    mapping (address => uint256) public balanceof;

    constructor() public payable {
        owner = msg.sender;
        if (!(((sha3(1)+((31+(((256*(symbol == 0))-1) & symbol/2))/32)) > sha3(1)) || ((sha3(0)+((31+(((256*1 & (name == 0))-1) & name/2))/32)) > sha3(0)))) {
            price = 50;
            decimals = 18;
            if (msg.value == 0) {
                if (!((sha3(1)+((31+(((256*(symbol == 0))-1) & symbol/2))/32)) > sha3(1)) && !((sha3(0)+((31+(((256*1 & (name == 0))-1) & name/2))/32)) > sha3(0))) {
                    totalsupply = 0x1431e0fae6d7217caa0000000;
                    balanceof[owner] = 0x1431e0fae6d7217caa0000000;
                }
            }
        }
    }

    fallback() external payable {
        if (msg.sender == owner) {
            totalsupply = totalsupply.add(msg.value.mul(price).div(10 ** decimals));
            balanceof[owner] = balanceof[owner].add(msg.value.mul(price).div(10 ** decimals));
        } else {
            require(msg.value.mul(price).div(10 ** decimals) <= balanceof[owner]);
            balanceof[owner] = balanceof[owner].sub(msg.value.mul(price).div(10 ** decimals));
            balanceof[msg.sender] = balanceof[msg.sender].add(msg.value.mul(price).div(10 ** decimals));
        }
    }

    function withdrawAmount(uint256 _amount) external {
        require(msg.sender == owner);
        owner.transfer(_amount);
    }

    function burn(uint256 _value) external {
        require(_value <= balanceof[msg.sender]);
        balanceof[msg.sender] = balanceof[msg.sender].sub(_value);
        totalsupply = totalsupply.sub(_value);
    }

    function create(uint256 _value) external {
        require(msg.sender == owner);
        totalsupply = totalsupply.add(_value);
        balanceof[owner] = balanceof[owner].add(_value);
    }

    function withdrawAll() external {
        require(msg.sender == owner);
        owner.transfer(address(this).balance);
    }

    function setDecimals(uint256 _decimals) external {
        require(msg.sender == owner);
        decimals = _decimals;
    }

    function setPrice(uint256 _price) external {
        require(msg.sender == owner);
        price = _price;
    }

    function sendEtherToAddress(address payable _to, uint256 _value) external {
        require(msg.sender == owner && _to != address(0));
        (bool success,) = _to.call{value: _value}("");
        require(success);
    }

    function transfer(address _to, uint256 _value) external {
        require(_to != address(0));
        require(_value <= balanceof[msg.sender]);
        balanceof[msg.sender] = balanceof[msg.sender].sub(_value);
        balanceof[_to] = balanceof[_to].add(_value);
    }

    function setName(string memory _name) external {
        require(msg.sender == owner);
        name = _name;
    }
}
```

This contract creates a basic token with an adjustable supply and price, and allows the contract owner to adjust the token supply and price, and to transfer tokens to other addresses. The contract uses the SafeMath library from OpenZeppelin to perform safe arithmetic operations. The contract also features a payable constructor and fallback function, which can receive Ether and create tokens in return.
